// src/components/NewsList.js
import React from 'react';

const NewsList = ({ news }) => {
    return (
        <ul>
            {news.map((newsItem) => (
                <li key={newsItem.id}>
                    <h3>{newsItem.title}</h3>
                    <p>{newsItem.content}</p>
                </li>
            ))}
        </ul>
    );
};

export default NewsList;
